import { useEffect } from 'react'
import usersApi from '../setup/usersApi'

export default function GetUsers(id = null) {

    useEffect(() => {
        const fetchUsersList = async () => {
            let users = {}

            try {
                // const params = { _page: 1, _limit: 10 };
                const response = id ? await usersApi.get(id) : await usersApi.getAll(id)
                users = response
                return users
                // console.log(users);
            } catch (error) {
                console.log('Failed to fetch product list: ', error);
            }
        }
        fetchUsersList();

    }, [])
}
